import { useEffect, useState } from "react";



function Addcart() {

    const [data, setData] = useState([])
    useEffect(() => {
        fetch("http://localhost:3005/Add-Cart")

            .then((res) => {
                return res.json()
            })

            .then((resp) => {
                setData(resp)
            })




    })

    return (
        <div>

            {data.map((item) => (
                <div id="data">
                    <p><img src={item.image} style={{ width: "160px", height: "100px" }} /> </p>
                    <h4>{item.brand}</h4>
                    <p>{item.name}</p>
                    <h6><i class="fa-solid fa-indian-rupee-sign"></i> {item.price}</h6>
                    <button id="addcart" onClick={() => { Addcart(item.id) }}>Add-cart</button>
                </div>

            ))}


        </div>
    )
}
export default Addcart;
